INSERT INTO `wp_options` VALUES('354', '_transient_storefront_child_themes', 'O:8:\"stdClass\":1:{s:8:\"products\";a:14:{i:0;O:8:\"stdClass\":5:{s:5:\"title\";s:6:\"Bistro\";s:5:\"image\";s:77:\"https://woocommerce.com/wp-content/uploads/2016/07/bistro-featured1.png?w=980\";s:7:\"excerpt\";s:174:\"Bistro is a Storefront child theme designed for stores selling organic goods and other consumables. It features a friendly and warm design that lends itself to this industry.\";s:4:\"link\";s:107:\"https://woocommerce.com/products/bistro/?utm_source=product&utm_medium=upsell&utm_campaign=storefrontaddons\";s:5:\"price\";s:10:\"&#36;39.00\";}i:1;O:8:\"stdClass\":5:{s:5:\"title\";s:10:\"Stationery\";s:5:\"image\";s:71:\"https://woocommerce.com/wp-content/uploads/2016/04/stationery.jpg?w=980\";s:7:\"excerpt\";s:186:\"Stationery is a Storefront child theme designed for stores selling office supplies and/or arts &amp; crafts. The design has subtle tactile decorations while also being clean and elegant.\";s:4:\"link\";s:111:\"https://woocommerce.com/products/stationery/?utm_source=product&utm_medium=upsell&utm_campaign=storefrontaddons\";s:5:\"price\";s:10:\"&#36;39.00\";}i:2;O:8:\"stdClass\":5:{s:5:\"title\";s:7:\"Petshop\";s:5:\"image\";s:68:\"https://woocommerce.com/wp-content/uploads/2016/03/petshop.png?w=980\";s:7:\"excerpt\";s:181:\"Petshop is a Storefront child theme designed for stores selling products in the pet industry. The design is organic and friendly, featuring many details that point to pet ownership.\";s:4:\"link\";s:108:\"https://woocommerce.com/products/petshop/?utm_source=product&utm_medium=upsell&utm_campaign=storefrontaddons\";s:5:\"price\";s:10:\"&#36;39.00\";}i:3;O:8:\"stdClass\":5:{s:5:\"title\";s:5:\"Hotel\";s:5:\"image\";s:75:\"https://woocommerce.com/wp-content/uploads/2016/03/hotel-featured.jpg?w=980\";s:7:\"excerpt\";s:246:\"Hotel is designed for businesses selling time, services and accommodation, offering unique integration withWooCommerce Bookings and Accommodation Bookings. The design is bold yetsimple, allowing your content and imagery to do all the talking.\";s:4:\"link\";s:106:\"https://woocommerce.com/products/hotel/?utm_source=product&utm_medium=upsell&utm_campaign=storefrontaddons\";s:5:\"price\";s:10:\"&#36;39.00\";}i:4;O:8:\"stdClass\":5:{s:5:\"title\";s:8:\"Bookshop\";s:5:\"image\";s:69:\"https://woocommerce.com/wp-content/uploads/2016/02/featured.png?w=980\";s:7:\"excerpt\";s:183:\"Bookshop comes with a unique homepage layout that prominently displays product categories and a variety of products in an arrangement that is popular with bookstores and collectibles.\";s:4:\"link\";s:109:\"https://woocommerce.com/products/bookshop/?utm_source=product&utm_medium=upsell&utm_campaign=storefrontaddons\";s:5:\"price\";s:10:\"&#36;39.00\";}i:5;O:8:\"stdClass\":5:{s:5:\"title\";s:6:\"Arcade\";s:5:\"image\";s:67:\"https://woocommerce.com/wp-content/uploads/2016/01/arcade.png?w=980\";s:7:\"excerpt\";s:216:\"Upgrade your video game shops look and feel with Arcade. It\'s bold and modern design will engage visitors and the unique homepage layout will present them with a variety of products as soon as they hit your homepage.\";s:4:\"link\";s:107:\"https://woocommerce.com/products/arcade/?utm_source=product&utm_medium=upsell&utm_campaign=storefrontaddons\";s:5:\"price\";s:10:\"&#36;39.00\";}i:6;O:8:\"stdClass\":5:{s:5:\"title\";s:9:\"Homestore\";s:5:\"image\";s:70:\"https://woocommerce.com/wp-content/uploads/2015/12/homestore.jpg?w=980\";s:7:\"excerpt\";s:166:\"Give your Department Store a classic look with Homestore. Its clean and efficient design willwork well whether you\'re a boutique independent or a high street giant.\";s:4:\"link\";s:110:\"https://woocommerce.com/products/homestore/?utm_source=product&utm_medium=upsell&utm_campaign=storefrontaddons\";s:5:\"price\";s:10:\"&#36;39.00\";}i:7;O:8:\"stdClass\":5:{s:5:\"title\";s:8:\"Pharmacy\";s:5:\"image\";s:69:\"https://woocommerce.com/wp-content/uploads/2015/12/pharmacy.jpg?w=980\";s:7:\"excerpt\";s:235:\"Give your health store a professional, trust-worthy design with the Pharmacy Storefront Child Theme. Built upon our rock solid Storefront Parent theme you\'ll also enjoy reliable integration with current and future WooCommerce releases.\";s:4:\"link\";s:109:\"https://woocommerce.com/products/pharmacy/?utm_source=product&utm_medium=upsell&utm_campaign=storefrontaddons\";s:5:\"price\";s:10:\"&#36;39.00\";}i:8;O:8:\"stdClass\":5:{s:5:\"title\";s:7:\"ToyShop\";s:5:\"image\";s:68:\"https://woocommerce.com/wp-content/uploads/2015/09/toyshop.jpg?w=980\";s:7:\"excerpt\";s:548:\"<p style=\"margin-bottom: 1.618em;\">Add some fun to your store with ToyShop. The engaging and colorful design of ToyShop makes it a perfect child theme or any store that sells exciting products that are aimed at customers that like to have fun. The outdoorsy style would even be perfect for a flower shop.</p>\r\n<p style=\"margin-bottom: 1.618em;\">Be sure to check out both demos:</p>\r\n<a class=\"button\" href=\"http://demo2.woothemes.com/toyshop/\">Children\'s Fashion</a> <a class=\"button\" href=\"http://demo2.woothemes.com/garys-garden/\">Flower Shop</a>\";s:4:\"link\";s:108:\"https://woocommerce.com/products/toyshop/?utm_source=product&utm_medium=upsell&utm_campaign=storefrontaddons\";s:5:\"price\";s:10:\"&#36;39.00\";}i:9;O:8:\"stdClass\":5:{s:5:\"title\";s:6:\"Outlet\";s:5:\"image\";s:67:\"https://woocommerce.com/wp-content/uploads/2015/09/outlet.jpg?w=980\";s:7:\"excerpt\";s:221:\"Overclock your tech store with Outlet! Whether you sell boutique iPad jewellery or the nuts and bolts of hardware itself, Outlet will give your shop a stylish look and feel while enjoying the stability of Storefront core.\";s:4:\"link\";s:107:\"https://woocommerce.com/products/outlet/?utm_source=product&utm_medium=upsell&utm_campaign=storefrontaddons\";s:5:\"price\";s:10:\"&#36;39.00\";}i:10;O:8:\"stdClass\":5:{s:5:\"title\";s:7:\"ProShop\";s:5:\"image\";s:68:\"https://woocommerce.com/wp-content/uploads/2015/06/proshop.jpg?w=980\";s:7:\"excerpt\";s:181:\"Unlock the true potential of your sports clothing and equipment store with ProShop! It&#039;s metropolitan design provides an active aesthetic giving your store oodles of character.\";s:4:\"link\";s:108:\"https://woocommerce.com/products/proshop/?utm_source=product&utm_medium=upsell&utm_campaign=storefrontaddons\";s:5:\"price\";s:10:\"&#36;39.00\";}i:11;O:8:\"stdClass\":5:{s:5:\"title\";s:8:\"Galleria\";s:5:\"image\";s:69:\"https://woocommerce.com/wp-content/uploads/2015/05/galleria.jpg?w=980\";s:7:\"excerpt\";s:563:\"<p style=\"margin-bottom: 1.618em;\">Galleria is a Storefront child theme perfect for fashion and design stores. Stylish and minimalist, itgives sites a high class look and keeps products centerstage.</p>\r\n\r\n<p style=\"margin-bottom: 1.618em;\">Be sure to check out each of the Galleria demos:</p>\r\n\r\n<p><a href=\"http://demo2.woothemes.com/garys/\" class=\"button\">Men&#039;s Fashion</a> <a href=\"http://demo2.woothemes.com/galleria/\" class=\"button\">Women&#039;s Fashion</a> <a href=\"http://demo2.woothemes.com/happy-little-paintings/\" class=\"button\">Art Shop</a></p>\";s:4:\"link\";s:109:\"https://woocommerce.com/products/galleria/?utm_source=product&utm_medium=upsell&utm_campaign=storefrontaddons\";s:5:\"price\";s:10:\"&#36;39.00\";}i:12;O:8:\"stdClass\":5:{s:5:\"title\";s:4:\"Deli\";s:5:\"image\";s:65:\"https://woocommerce.com/wp-content/uploads/2015/03/deli.jpg?w=980\";s:7:\"excerpt\";s:276:\"Deli is a Storefront child theme featuring a texturised, earthy design, perfect for stores selling natural, organic or hand made goods.\r\n\r\nBeing a child theme, Deli provides a quirky new design for your shop while still being powered by the rock solid Storefront parent theme.\";s:4:\"link\";s:105:\"https://woocommerce.com/products/deli/?utm_source=product&utm_medium=upsell&utm_campaign=storefrontaddons\";s:5:\"price\";s:9:\"&#36;0.00\";}i:13;O:8:\"stdClass\":5:{s:5:\"title\";s:8:\"Boutique\";s:5:\"image\";s:69:\"https://woocommerce.com/wp-content/uploads/2015/01/boutique.png?w=980\";s:7:\"excerpt\";s:168:\"Boutique is a simple, traditionally designed Storefront child theme, ideal for small stores or boutiques. Add your logo, create a unique color scheme and start selling!\";s:4:\"link\";s:109:\"https://woocommerce.com/products/boutique/?utm_source=product&utm_medium=upsell&utm_campaign=storefrontaddons\";s:5:\"price\";s:9:\"&#36;0.00\";}}}', 'no');
