INSERT INTO `wp_options` VALUES('758', 'go_pricing_update_data', 'a:1:{s:13:\"gw-go-pricing\";a:5:{s:2:\"id\";s:10:\"go_pricing\";s:4:\"slug\";s:13:\"gw-go-pricing\";s:4:\"base\";s:25:\"go_pricing/go_pricing.php\";s:7:\"version\";s:5:\"3.3.6\";s:8:\"api_data\";a:14:{s:2:\"id\";s:10:\"go_pricing\";s:4:\"name\";s:48:\"Go Pricing - WordPress Responsive Pricing Tables\";s:9:\"shortname\";s:10:\"Go Pricing\";s:11:\"description\";s:2049:\"<p style=\"margin-top: 0;\"><a href=\"http://codecanyon.net/item/go-pricing-wordpress-responsive-pricing-tables/3725820?ref=Granth\" rel=\"attachment wp-att-2510\"><img class=\"alignnone size-full wp-image-2510\" src=\"http://granthweb.com/granthweb.com/wp-content/uploads/go_logo-2.png\" alt=\"go_pricing_logo\" width=\"225\" height=\"50\" /></a></p>\r\n\r\n<h3 style=\"margin-top: 0;\">Create amazing WordPress Pricing &amp; Compare Tables</h3>\r\nIts very easy to create WordPress pricing or compare tables with Go Pricing. If you buy this product, you dont need anything else.\r\n\r\nThis WordPress Pricing Tables supports various Media Elements like Audio, Video, Image or Map. Just give a try, we are sure you will never turn back to search more.\r\n<h3>Classic and Modern in one? Yes.</h3>\r\nIf you like traditional WordPress Pricing Tables, but you would like get much more out of it, then this rodded product is a useful tool for you. Beside the usual pricing table style Videos (Youtube, Vimeo, Screenr) and Images are also supported with optional responsivity.\r\n\r\nIts very easy and fast to create stunning tables and integrate them into your WordPress site using <a href=\"https://www.youtube.com/watch?v=xCAd4oC5nRs&amp;index=1&amp;list=PL9NbJzjOaEKA3pC_kQrY1UBCXBrgiejOY\" target=\"_blank\">Admin Panel</a>. You will surely find the one most appropriate for you, which can be customized in a few seconds.\r\n<h3>For what other purposes can I you use this? We have some ideas.</h3>\r\nBeside traditional Pricing Tables feature the plugin is suitable also for creating Team Viewer and Compare Tables. These features can also be found in the package.\r\n<h3>Is the sytem flexible? Yes.</h3>\r\nThe responsivity is optional. It can be turned On and Off and customizable to adapt to your site or CSS framework (e.g. Bootstrap). You can use System or any Google Web Fonts (650+).\r\n<h3>Can I use more than one table on my site? Yes.</h3>\r\nYou can use any number of tables on your site or even on one single page using shortcodes.\r\n\r\n<strong>Go. Just Create!.</strong>\r\n\r\n&nbsp;\";s:17:\"short_description\";N;s:7:\"tagline\";N;s:9:\"thumbnail\";s:70:\"http://granthweb.com/granthweb.com/wp-content/uploads/thumbnail_-3.png\";s:3:\"url\";s:92:\"http://codecanyon.net/item/go-pricing-wordpress-responsive-pricing-tables/3725820?ref=Granth\";s:12:\"purchase_url\";s:92:\"http://codecanyon.net/item/go-pricing-wordpress-responsive-pricing-tables/3725820?ref=Granth\";s:8:\"core_min\";N;s:6:\"wp_min\";s:3:\"3.5\";s:6:\"wp_max\";s:3:\"4.8\";s:7:\"version\";s:5:\"3.3.8\";s:4:\"date\";s:10:\"05-09-2017\";}}}', 'yes');
