INSERT INTO `wp_options` VALUES('1384', '_transient_go_pricing_4e85563560f5f8c8053d9afa9fecdd57', 'a:6:{s:7:\"headers\";O:42:\"Requests_Utility_CaseInsensitiveDictionary\":1:{s:7:\"\0*\0data\";a:8:{s:4:\"date\";s:29:\"Fri, 12 May 2017 03:16:42 GMT\";s:12:\"content-type\";s:16:\"application/json\";s:10:\"set-cookie\";s:130:\"__cfduid=d0a85e8c7e8dc98ead67780024eada98f1494559002; expires=Sat, 12-May-18 03:16:42 GMT; path=/; domain=.granthweb.com; HttpOnly\";s:10:\"cf-railgun\";s:36:\"direct (starting new WAN connection)\";s:12:\"x-powered-by\";s:10:\"PHP/5.5.34\";s:6:\"server\";s:16:\"cloudflare-nginx\";s:6:\"cf-ray\";s:20:\"35da3884b32c2969-DUB\";s:16:\"content-encoding\";s:4:\"gzip\";}}s:4:\"body\";s:4429:\"{\"response\":\"success\",\"data\":{\"id\":\"go_pricing\",\"name\":\"Go Pricing - WordPress Responsive Pricing Tables\",\"shortname\":\"Go Pricing\",\"description\":\"<p style=\\\"margin-top: 0;\\\"><a href=\\\"http:\\/\\/codecanyon.net\\/item\\/go-pricing-wordpress-responsive-pricing-tables\\/3725820?ref=Granth\\\" rel=\\\"attachment wp-att-2510\\\"><img class=\\\"alignnone size-full wp-image-2510\\\" src=\\\"http:\\/\\/granthweb.com\\/granthweb.com\\/wp-content\\/uploads\\/go_logo-2.png\\\" alt=\\\"go_pricing_logo\\\" width=\\\"225\\\" height=\\\"50\\\" \\/><\\/a><\\/p>\\r\\n\\r\\n<h3 style=\\\"margin-top: 0;\\\">Create amazing WordPress Pricing &amp; Compare Tables<\\/h3>\\r\\nIt\\u2019s very easy to create WordPress pricing or compare tables with Go Pricing. If you buy this product, you don\\u2019t need anything else.\\r\\n\\r\\nThis WordPress Pricing Tables supports various Media Elements like Audio, Video, Image or Map. Just give a try, we are sure you will never turn back to search more.\\r\\n<h3>Classic and Modern in one? Yes.<\\/h3>\\r\\nIf you like traditional WordPress Pricing Tables, but you would like get much more out of it, then this rodded product is a useful tool for you. Beside the usual pricing table style Videos (Youtube, Vimeo, Screenr) and Images are also supported with optional responsivity.\\r\\n\\r\\nIt\\u2019s very easy and fast to create stunning tables and integrate them into your WordPress site using <a href=\\\"https:\\/\\/www.youtube.com\\/watch?v=xCAd4oC5nRs&amp;index=1&amp;list=PL9NbJzjOaEKA3pC_kQrY1UBCXBrgiejOY\\\" target=\\\"_blank\\\">Admin Panel<\\/a>. You will surely find the one most appropriate for you, which can be customized in a few seconds.\\r\\n<h3>For what other purposes can I you use this? We have some ideas.<\\/h3>\\r\\nBeside traditional Pricing Tables feature the plugin is suitable also for creating Team Viewer and Compare Tables. These features can also be found in the package.\\r\\n<h3>Is the sytem flexible? Yes.<\\/h3>\\r\\nThe responsivity is optional. It can be turned On and Off and customizable to adapt to your site or CSS framework (e.g. Bootstrap). You can use System or any Google Web Fonts (650+).\\r\\n<h3>Can I use more than one table on my site? Yes.<\\/h3>\\r\\nYou can use any number of tables on your site or even on one single page using shortcodes.\\r\\n\\r\\n<strong>Go. Just Create!.<\\/strong>\\r\\n\\r\\n&nbsp;\",\"short_description\":null,\"tagline\":null,\"thumbnail\":\"http:\\/\\/granthweb.com\\/granthweb.com\\/wp-content\\/uploads\\/thumbnail_-3.png\",\"url\":\"http:\\/\\/codecanyon.net\\/item\\/go-pricing-wordpress-responsive-pricing-tables\\/3725820?ref=Granth\",\"purchase_url\":\"http:\\/\\/codecanyon.net\\/item\\/go-pricing-wordpress-responsive-pricing-tables\\/3725820?ref=Granth\",\"core_min\":null,\"wp_min\":\"3.5\",\"wp_max\":\"4.7\",\"version\":\"3.3.7\",\"date\":\"03-05-2017\",\"addons\":{\"clip_addon\":{\"id\":\"clip_addon\",\"name\":\"Clip - Add-on for Go Pricing\",\"shortname\":\"Clip\",\"description\":null,\"short_description\":\"By using \'Clip \\u2013 Add-on for Go Pricing\' you can get pricing tables done way faster than before. You can add a Row or the entire content of a Column to the Clipboard by simply one click, they also can be reloaded using the Drag & Drop tool.\",\"tagline\":\"It\'s more than just Copy Paste\",\"thumbnail\":\"http:\\/\\/granthweb.com\\/granthweb.com\\/wp-content\\/uploads\\/thumbnail_-6.png\",\"url\":\"https:\\/\\/codecanyon.net\\/item\\/clip-addon-for-go-pricing\\/13216605?ref=Granth\",\"purchase_url\":\"https:\\/\\/codecanyon.net\\/item\\/clip-addon-for-go-pricing\\/13216605?ref=Granth\",\"core_min\":\"3.1.1\",\"wp_min\":\"3.5\",\"wp_max\":\"4.7\",\"version\":\"2.0\",\"date\":\"21-04-2016\"},\"yet_addon\":{\"id\":\"yet_addon\",\"name\":\"Yet Skin - Add-on for Go Pricing\",\"shortname\":\"Yet Skin\",\"description\":null,\"short_description\":\"Yet will enable you to create totally unique tables that fit perfectly to your style and theme.\\r\\nExpress your tables in complete freedom, this time only your imagination is the limit. Yet is a skin that expands your table editing capabilities by letting you configuring almost anything without coding knowledge.\",\"tagline\":\"Turbo-Charge with Creative\\r\\nStyles \",\"thumbnail\":\"http:\\/\\/granthweb.com\\/granthweb.com\\/wp-content\\/uploads\\/yet_thumbnail-1.png\",\"url\":\"https:\\/\\/codecanyon.net\\/item\\/yet-skin-addon-for-go-pricing\\/17449027?ref=Granth\",\"purchase_url\":\"https:\\/\\/codecanyon.net\\/item\\/yet-skin-addon-for-go-pricing\\/17449027?ref=Granth\",\"core_min\":\"3.3.2\",\"wp_min\":\"3.5\",\"wp_max\":\"4.7\",\"version\":\"1.1\",\"date\":\"03-05-2017\"}}},\"created_at\":\"04-05-2017 08:11:26 +00:00\"}\";s:8:\"response\";a:2:{s:4:\"code\";i:200;s:7:\"message\";s:2:\"OK\";}s:7:\"cookies\";a:1:{i:0;O:14:\"WP_Http_Cookie\":5:{s:4:\"name\";s:8:\"__cfduid\";s:5:\"value\";s:43:\"d0a85e8c7e8dc98ead67780024eada98f1494559002\";s:7:\"expires\";i:1526095002;s:4:\"path\";s:1:\"/\";s:6:\"domain\";s:13:\"granthweb.com\";}}s:8:\"filename\";N;s:13:\"http_response\";O:25:\"WP_HTTP_Requests_Response\":5:{s:11:\"\0*\0response\";O:17:\"Requests_Response\":10:{s:4:\"body\";s:4429:\"{\"response\":\"success\",\"data\":{\"id\":\"go