 be turned On and Off and customizable to adapt to your site or CSS framework (e.g. Bootstrap). You can use System or any Google Web Fonts (650+).\\r\\n<h3>Can I use more than one table on my site? Yes.<\\/h3>\\r\\nYou can use any number of tables on your site or even on one single page using shortcodes.\\r\\n\\r\\n<strong>Go. Just Create!.<\\/strong>\\r\\n\\r\\n&nbsp;\",\"short_description\":null,\"tagline\":null,\"thumbnail\":\"http:\\/\\/granthweb.com\\/granthweb.com\\/wp-content\\/uploads\\/thumbnail_-3.png\",\"url\":\"http:\\/\\/codecanyon.net\\/item\\/go-pricing-wordpress-responsive-pricing-tables\\/3725820?ref=Granth\",\"purchase_url\":\"http:\\/\\/codecanyon.net\\/item\\/go-pricing-wordpress-responsive-pricing-tables\\/3725820?ref=Granth\",\"core_min\":null,\"wp_min\":\"3.5\",\"wp_max\":\"4.7\",\"version\":\"3.3.7\",\"date\":\"03-05-2017\",\"addons\":{\"clip_addon\":{\"id\":\"clip_addon\",\"name\":\"Clip - Add-on for Go Pricing\",\"shortname\":\"Clip\",\"description\":null,\"short_description\":\"By using \'Clip \\u2013 Add-on for Go Pricing\' you can get pricing tables done way faster than before. You can add a Row or the entire content of a Column to the Clipboard by simply one click, they also can be reloaded using the Drag & Drop tool.\",\"tagline\":\"It\'s more than just Copy Paste\",\"thumbnail\":\"http:\\/\\/granthweb.com\\/granthweb.com\\/wp-content\\/uploads\\/thumbnail_-6.png\",\"url\":\"https:\\/\\/codecanyon.net\\/item\\/clip-addon-for-go-pricing\\/13216605?ref=Granth\",\"purchase_url\":\"https:\\/\\/codecanyon.net\\/item\\/clip-addon-for-go-pricing\\/13216605?ref=Granth\",\"core_min\":\"3.1.1\",\"wp_min\":\"3.5\",\"wp_max\":\"4.7\",\"version\":\"2.0\",\"date\":\"21-04-2016\"},\"yet_addon\":{\"id\":\"yet_addon\",\"name\":\"Yet Skin - Add-on for Go Pricing\",\"shortname\":\"Yet Skin\",\"description\":null,\"short_description\":\"Yet will enable you to create totally unique tables that fit perfectly to your style and theme.\\r\\nExpress your tables