INSERT INTO `wp_options` VALUES('10921', '_transient_go_pricing_646e636dff83eb7fcabad1f3668c4730', 'a:6:{s:7:\"headers\";O:42:\"Requests_Utility_CaseInsensitiveDictionary\":1:{s:7:\"\0*\0data\";a:8:{s:4:\"date\";s:29:\"Mon, 09 Oct 2017 23:20:30 GMT\";s:12:\"content-type\";s:16:\"application/json\";s:10:\"set-cookie\";s:130:\"__cfduid=d8e284e33c58377796d1ead59b6b223e41507591230; expires=Tue, 09-Oct-18 23:20:30 GMT; path=/; domain=.granthweb.com; HttpOnly\";s:10:\"cf-railgun\";s:34:\"1dead865d0 0.47 0.002979 0030 e6be\";s:12:\"x-powered-by\";s:10:\"PHP/5.5.34\";s:6:\"server\";s:16:\"cloudflare-nginx\";s:6:\"cf-ray\";s:20:\"3ab51226f0cd367d-MAN\";s:16:\"content-encoding\";s:4:\"gzip\";}}s:4:\"body\";s:4429:\"{\"response\":\"success\",\"data\":{\"id\":\"go_pricing\",\"name\":\"Go Pricing - WordPress Responsive Pricing Tables\",\"shortname\":\"Go Pricing\",\"description\":\"<p style=\\\"margin-top: 0;\\\"><a href=\\\"http:\\/\\/codecanyon.net\\/item\\/go-pricing-wordpress-responsive-pricing-tables\\/3725820?ref=Granth\\\" rel=\\\"attachment wp-att-2510\\\"><img class=\\\"alignnone size-full wp-image-2510\\\" src=\\\"http:\\/\\/granthweb.com\\/granthweb.com\\/wp-content\\/uploads\\/go_logo-2.png\\\" alt=\\\"go_pricing_logo\\\" width=\\\"225\\\" height=\\\"50\\\" \\/><\\/a><\\/p>\\r\\n\\r\\n<h3 style=\\\"margin-top: 0;\\\">Create amazing WordPress Pricing &amp; Compare Tables<\\/h3>\\r\\nIt\\u2019s very easy to create WordPress pricing or compare tables with Go Pricing. If you buy this product, you don\\u2019t need anything else.\\r\\n\\r\\nThis WordPress Pricing Tables supports various Media Elements like Audio, Video, Image or Map. Just give a try, we are sure you will never turn back to search more.\\r\\n<h3>Classic and Modern in one? Yes.<\\/h3>\\r\\nIf you like traditional WordPress Pricing Tables, but you would like get much more out of it, then this rodded product is a useful tool for you. Beside the usual pricing table style Videos (Youtube, Vimeo, Screenr) and Images are also supported with optional responsivity.\\r\\n\\r\\nIt\\u2019s very easy and fast to create stunning tables and integrate them into your WordPress site using <a href=\\\"https:\\/\\/www.youtube.com\\/watch?v=xCAd4oC5nRs&amp;index=1&amp;list=PL9NbJzjOaEKA3pC_kQrY1UBCXBrgiejOY\\\" target=\\\"_blank\\\">Admin Panel<\\/a>. You will surely find the one most appropriate for you, which can be customized in a few seconds.\\r\\n<h3>For what other purposes can I you use this? We have some ideas.<\\/h3>\\r\\nBeside traditional Pricing Tables feature the plugin is suitable also for creating Team Viewer and Compare Tables. These features can also be found in the package.\\r\\n<h3>Is the sytem flexible? Yes.<\\/h3>\\r\\nThe responsivity is optional. It can be turned On and Off and customizable to adapt to your site or CSS framework (e.g. Bootstrap). You can use System or any Google Web Fonts (650+).\\r\\n<h3>Can I use more than one table on my site? Yes.<\\/h3>\\r\\nYou can use any number of tables on your site or even on one single page using shortcodes.\\r\\n\\r\\n<strong>Go. Just Create!.<\\/strong>\\r\\n\\r\\n&nbsp;\",\"short_description\":null,\"tagline\":null,\"thumbnail\":\"http:\\/\\/granthweb.com\\/granthweb.com\\/wp-content\\/uploads\\/thumbnail_-3.png\",\"url\":\"http:\\/\\/codecanyon.net\\/item\\/go-pricing-wordpress-responsive-pricing-tables\\/3725820?ref=Granth\",\"purchase_url\":\"http:\\/\\/codecanyon.net\\/item\\/go-pricing-wordpress-responsive-pricing-tables\\/3725820?ref=Granth\",\"core_min\":null,\"wp_min\":\"3.5\",\"wp_max\":\"4.8\",\"version\":\"3.3.8\",\"date\":\"05-09-2017\",\"addons\":{\"clip_addon\":{\"id\":\"clip_addon\",\"name\":\"Clip - Add-on for Go Pricing\",\"shortname\":\"Clip\",\"description\":null,\"short_description\":\"By using \'Clip \\u2013 Add-on for Go Pricing\' you can get pricing tables done way faster than before. You can add a Row or the entire content of a Column to the Clipboard by simply one click, they also can be reloade